
import 'package:dartsv/dartsv.dart';
import 'package:test/test.dart';
import 'package:tstokenlib/tstokenlib.dart';
import 'package:collection/collection.dart';


void main(){

  Function listEquals = ListEquality().equals;

  test("description", (){
    //release build issuance
    var issuanceTxHex = "";

    // debug build issuance
    // var issuanceTxHex = "";

    var issuanceTx = Transaction.fromHex(issuanceTxHex);

    var issuancePP1Script = issuanceTx.outputs[1].script;
    var pp1Locker = PP1LockBuilder.fromScript(issuancePP1Script);

    expect(listEquals(pp1Locker.getScriptPubkey().buffer, issuancePP1Script.buffer), true);
  });
}